	<rect x="204.19" y="162.82" class="st61" width="1591.61" height="88.47"/>
	<text transform="matrix(1 0 0 1 204.1933 225.8164)" class="st67 st68">What’s your ideal partner?</text>
	<rect x="201.44" y="308.54" class="st61" width="1598.11" height="487.21"/>
	<text transform="matrix(1 0 0 1 201.4427 335.9)" class="st69"><tspan x="0" y="0" class="st70 st71">Dating apps have radically changed the dating game. Personalities are condensed into a single profile, </tspan><tspan x="0" y="43.2" class="st70 st71">often viewed for only a few seconds. We are confronted with a summary of a person&apos;s life, including </tspan><tspan x="0" y="86.4" class="st70 st71">information we would never know when meeting someone in person for the first time. I want to </tspan><tspan x="0" y="129.6" class="st70 st71">understand how people identify their ideal partners in the modern dating scene. </tspan><tspan x="0" y="216" class="st70 st71">I surveyed New School students on their ideal type. The questions are modeled after those used in </tspan><tspan x="0" y="259.2" class="st70 st71">dating profiles, such as height, zodiac, dating goals, etc. Using the data, I compiled the most popular </tspan><tspan x="0" y="302.4" class="st70 st71">traits into a single dating profile, creating the statistical &quot;most desirable&quot; person. </tspan><tspan x="0" y="388.8" class="st70 st71">Hover over the different traits to see the statistical breakdown of all the responses:</tspan></text>
	<rect x="201.62" y="2420.86" class="st61" width="1598.11" height="33.14"/>
	<text transform="matrix(1 0 0 1 201.6244 2448.2178)" class="st69 st70 st71">Many of these traits can be explained by the demographics of The New School student population: </text>

	<rect x="197.67" y="2514.99" class="st61" width="436.36" height="347.66"/>
	<text transform="matrix(1 0 0 1 197.6722 2542.3506)"><tspan x="0" y="0" class="st70 st71">Most college aged students </tspan><tspan x="0" y="43.2" class="st70 st71">are between 18-23.</tspan></text>
	<rect x="197.67" y="3138.85" class="st61" width="522.31" height="225.33"/>
	<text transform="matrix(1 0 0 1 197.6721 3166.209)"><tspan x="0" y="0" class="st70 st71">Most women do not have children </tspan><tspan x="0" y="43.2" class="st70 st71">until they are 23, 30 for men.</tspan></text>
	<rect x="202.42" y="3694.46" class="st61" width="517.57" height="133.8"/>
	<text transform="matrix(1 0 0 1 202.4173 3721.823)"><tspan x="0" y="0" class="st70 st71">The New School also has a large </tspan><tspan x="0" y="43.2" class="st70 st71">Asian population, especially </tspan><tspan x="0" y="86.4" class="st70 st71">Asian international students.</tspan></text>
	<rect x="763.83" y="4672.77" class="st61" width="472.35" height="35.48"/>
	<text transform="matrix(1 0 0 1 763.8249 4694.0498)" class="st70 st72">Designed and Written by Hannah Suh</text>
	<rect x="197.67" y="4266.86" class="st61" width="1597.54" height="295.14"/>
	<text transform="matrix(1 0 0 1 197.6722 4294.2217)"><tspan x="0" y="0" class="st70 st71">While interesting at first, the information commonly collected on dating apps revealed little about the </tspan><tspan x="0" y="43.2" class="st70 st71">personality and beliefs that make a valuable partner. Currently, I’m working on expanding this project by </tspan><tspan x="0" y="86.4" class="st70 st71">exploring better questions that dating apps should be asking to create meaningful connections. These </tspan><tspan x="0" y="129.6" class="st70 st71">questions would be open-ended and more philosophical, such as   “What is the purpose of dating?”, “How </tspan><tspan x="0" y="172.8" class="st70 st71">do you know you love someone?”, and “If love was a physical manifestation, what would it look like?”. </tspan></text>

<script type="text/javascript">

let tooltip=document.querySelector('.tooltip')

// gets position of mouse on the page
function getpos(event) {
	var e = window.event;
	x = e.clientX ;
	y = e.clientY ;
} 

function updateTooltip(text_to_display){
	tooltip.innerHTML=text_to_display
	getpos()
	tooltip.style.display='block'
	tooltip.style.opacity=1
	tooltip.style.left=x+30+"px"
	tooltip.style.top=y-30+"px"
}

function updateImgTooltip(img_to_display){
	tooltip.style.display='block'
	tooltip.innerHTML=''
	tooltip.style.opacity=1
	picture = document.createElement('img')
	picture.src=img_to_display
	tooltip.appendChild(picture)
	getpos()
	tooltip.style.left=x+30+"px"
	tooltip.style.top=y-30+"px"
}

function clearTooltip() {
	tooltip.style.display='none'
	tooltip.style.opacity=0
}

</script>
